import React from 'react';

import {
    Grid
} from '@material-ui/core';

export default function Home() {
    return (
        <Grid container justify='center' alignItems='center'>
            <Grid item xs={4}>
                <h1>Title</h1>
            </Grid>
            <Grid item xs={8}>
                <h1>Result</h1>
            </Grid>
        </Grid>
    )
}
